import React, {Component} from 'react'

class Header extends Component{
    render(){
        if(this.props === false){
            return(
            <header>
                <h2>This is the header Loading </h2>
            </header>
            )
        }else{
            return(
                <header>
                    <h2>This is the header rendered </h2>
                </header>
                )
        }
    }
}

export default Header
